// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.5.0 < 0.9.0 ;

// struct Student{

//     uint roll;
//     string name;
// }

contract Demo{

// Student public s1;

// constructor(uint _roll,string memory _name){

//     s1.roll = _roll;
//     s1.name = _name;
// }

// function change(uint _roll , string memory _name) public 
// {

//     Student memory new_student = Student({


//         roll : _roll,
//         name: _name
//     });

//      s1 = new_student;
// }


// mapping (uint=>string) public rollno;

// function setter(uint keys , string memory value) public
//  {

//     rollno[keys] = value;
// }


// memory vs storage

string[] public names = ['Ravi' , 'Rita' , 'Aman'];

function mem() public view{

    string[] memory s2 = names;
    s2[0] = 'Akash';
     }


     function sto() public {

    string[] storage s2 = names;
    s2[0] = 'Akash';
     }


    //  try executing both
    // memory will not change names array
    // storage will change names array and set 0th index to Akash
    // cause in storage s2 will be pointing to names
    //  in memory there will be a duplicate array named s2


     function getter() public view returns(uint,uint,address)
     {
         return (block.number , block.timestamp , msg.sender);
     }

// this function will retun current block no , timestamp that is at what time it was made and the msgsender that is who 
// sent this msg



function payether() public payable {
// this function is used to take ether into this contract from any account
// account to contract payment
// money is coming to this function so it is payable 

}

function getbalance() public view returns(uint){

    return address(this).balance;
    // will check contract of this balance
} 

}

